import Footer from "./components/footer/Footer";

function App() {
  const [popUp, setPopUp] = useState(false);
  return (
    <changeClassName.Provider value={{ popUp, setPopUp }}>
      <div className="App">
        <Router>
          <Navbar />
          {/* <Hero /> */}

          {/* <Content /> */}

          <AnimatedRoutes />
          <Footer />
        </Router>
      </div>
    </changeClassName.Provider>
  );
}

export default App;
